    public function actionSchool()
    {
        $data = $this->form;
        foreach($data as $item){
            foreach($item as $school){
                if($school[0] == "Наименование общеобразовательного учреждения"){
                    $this->schoolRepository->insertByName($school[1]);
                }
            }
        }
    }
    public function actionStudent(){
        $data = $this->form;
        $array = [];
        foreach($data as $item){
            $school = NULL;
            $surname = [];
            $name = [];
            $patronymic = [];
            $points = [];
            foreach($item as $element){
                if($element[0] == "Наименование общеобразовательного учреждения"){
                    $school = $this->schoolRepository->getByName($element[1]);
                }
                if($school != NULL) {
                    if ($school->id != NULL && ($element[0] == "Фамилия")) {
                        $surname[] = $element[1];
                    }
                    if ($school->id != NULL && ($element[0] == "Имя")) {
                        $name[] = $element[1];
                    }
                    if ($school->id != NULL && ($element[0] == "Отчество")) {
                        $patronymic[] = $element[1];
                    }
                    if ($school->id != NULL && ($element[0] == "Сумма баллов на школьном этапе ВсОШ по математике в 2024-2025 учебном году")) {
                        $points[] = (int)$element[1];
                    }
                }
            }
            array_shift($surname);
            array_pop($surname);
            array_shift($name);
            array_pop($name);
            array_shift($patronymic);
            array_pop($patronymic);
            array_push($array, ['SchoolId' => $school->id, 'Surname' => $surname, 'Name' => $name, 'Patronymic' => $patronymic, 'Points' => $points]);
        }
        foreach ($array as $items){
            for($i = 0; $i < count($items['Surname']); $i++){
                $this->studentRepository->insertByData( $items['Surname'][$i], $items['Name'][$i], $items['Patronymic'][$i], $items['SchoolId'], $items['Points'][$i]);
            }
        }
    }
    public function actionSquad($t)
    {
        $data = $this->form;
        $array = [];
        foreach($data as $item){
            $school = NULL;
            $squadName = NULL;
            foreach($item as $element){
                if($element[0] == "Наименование общеобразовательного учреждения"){
                    $school = $this->schoolRepository->getByName($element[1]);
                }
                if($school != NULL) {
                    if ($school->id != NULL && ($element[0] == "Название команды")) {
                        $squadName = $element[1];
                    }
                }
            }
            array_push($array, ['name' => $squadName ,'SchoolId' => $school->id, 'tournamentId' => $t]);
        }
        foreach ($array as $item) {
            $this->squadRepository->insertByData($item['name'], $item['SchoolId'], $item['tournamentId']);
        }
    }
